script: |
  super -f text -I q3249.spq | sort > q3249.out

inputs:
  - name: q3249.spq
    data: |
      SELECT DISTINCT + col1 * 33 - col0 AS col2 FROM tab2 (FORMAT parquet) WHERE ( NOT 30 / + - ( - 76 ) > + col1 );
  - name: tab2

outputs:
  - name: q3249.out
    data: |
      1637
      2136
      2477
